import React from "react";
import main from './assets/main.jpg';
import SimpleNavbar from "./SimpleNavbar";
import { Link } from "react-router-dom";

export default function Home() {
  const btnStyle = {

  };
  return (
    <div 
    style={{
      display: "flex"
    }}>
    <img 
        src={main} 
        alt="Coffee Shop Main" 
        style={{ 
          maxWidth: "100%", 
          height: "auto", 
          borderRadius: "10px",
          marginBottom: "1.5rem" 
        }} 
      />
      <div>
      <SimpleNavbar />
      <h1>Welcome to the Coffee Shop</h1>
      <p>Click below to browse our drinks!</p>
      <Link to="/coffee">
        <button style={btnStyle}>Go to Shop</button>
      </Link>
      </div>
    </div>
  );
}
